	(197, 600000, 900000, 1, 1, 1369, 'PISTOLA PROFESIONAL PARA APLICACION DE PINTURAS BASE AGUA, ACRILICA Y MONOCAPA FABRICADA EN ACERO FORJADO EXTREMADAMENTE RESISTENTE SISTEMA DE ATOMIZADOR PATENTADO H.V.L.P : TRANSFERENCIA MAYOR AL 70%, GRAN ABANICO PARA UN MAYOR CUBRIMIENTO, ECOLOGICAS HASTA UN 30% DE AHORRO DE PRODUCTO, INTERIOR EN BRONCE RELOJ DE PRESION DIGITAL RESISTENTE A DISOLVENTES  Descripción PISTOLA CON ATOMIZADOR PATENTADO TECNOLOGIA H.V.L.P(siglas en inglés que significan «alto volumen y baja presión») CONSUMO DE AIRE: 285L/MIN PRESION DE TRABAJO: 2 bAR/29PSI DIAMETRO DE PULVERIZACIÓN: 1,4 INCLUYE: BASE PROFESIONAL PARA APLICACION DE PINTURAS EN ACERO FORJADO MANOMETRO DE PRESION RESISTENTE A DISOLVENTES PRECISIÓN :0.5 psi COPA ITALCO DE ALTA RESISTENCIA CAPACIDAD 500ML KIT DE AGUJAS DE RECAMBIO INCLUYE BOQUILLA DE PULVERIZACIÓN, DE ATOMIZADOR Y AGUJA.  ¿Y por qué son ideales para este tipo de requerimientos? Porque cada una de las condiciones de trabajo de estos dispositivos aporta su beneficio:  ALTO VOLUMEN: esto significa que un mayor volumen de pintura sale de la boquilla de la pistola e impacta en la superficie a pintar. BAJA PRESION:: esto significa que se reduce la atomización de la pintura, con lo que se obtiene menos exceso de pulverización, menos residuos y menos contaminación. Por lo tanto, si combinamos estas características, el resultado es un acabado más profesional y un menor costo de pintura.  Dicho de otra manera, y como apreciamos en el video, al emplear un mayor volumen de pintura y una menor presión de aire, las pistolas HVLP pueden controlar de manera fiable la distribución uniforme de la pintura. Esto se traducirá directamente en ahorro, tanto de dinero al minimizar el desperdicio de pintura debido al exceso de pulverización y a las salpicaduras del material, como de tiempo, al no tener que refinar las líneas de pintura que dejan otros dispositivos.  Categorías: Herramientas, Herramientas Electricas, Pistola de Spray Etiquetas: c