	(268, 226000, 260000, 1, 1, 1817, 'La unidad de cuarzo japonesa (baterías incluidas) Ajuste del bisel bidireccional 10 atm water prof Cerradura de grillete: sujeción segura a través de un sujetador de acero inoxidable Diseño de la llanta tridimensional Diámetro de la caja: 43mm Grueso de la carcasa: 12mm Ancho de la pulsera: 20mm Los elementos del reloj de llanta están hechos de acero inoxidable: un material que se caracteriza por su durabilidad y robustez. Te da una comodidad distintiva. Esto se debe a que el acero inoxidable alcanza una dureza de 200 a 240 Vickers. La cubierta de la vivienda consiste en vidrio mineral endurecido. Es un vidrio de cristal, que protege eficazmente contra los arañazos y es fácil de limpiar. El vidrio es muy estable e irrompible y permite ver claramente los detalles del borde. El brazalete de eslabones es ajustable en tamaño y por lo tanto se ajusta a casi todas las muñecas. Los eslabones individualmente desmontables permiten acortar el brazalete con una longitud original de 18 cm a 14 cm. Por lo tanto, la circunferencia del reloj, incluida la caja, está entre 18 y 22 cm.', 'RELOJ TIPO RIN LLANTA DEPORTIVO FERRARI 488', NULL, NULL, NULL, NULL, 86, 1, '2022-08-09 21:35:01', '2022-09-19 17:00:16');
